import 'package:flutter/material.dart';
import 'package:flutter_test/flutter_test.dart';
import 'package:foodex_app/app/router/routes.dart';

import 'package:foodex_app/app/theme/theme.dart';
import 'package:get/get_navigation/src/root/get_material_app.dart';
import 'package:integration_test/integration_test.dart';
import 'package:provider/provider.dart';

void main() {
  IntegrationTestWidgetsFlutterBinding.ensureInitialized();
  testWidgets('Automate Login User Test', (WidgetTester tester) async {
    await tester.pumpWidget(ChangeNotifierProvider(
        create: (context) => ThemeProvider(),
        builder: (context, _) {
          final themeProvider = Provider.of<ThemeProvider>(context);
          return GetMaterialApp(
            debugShowCheckedModeBanner: false,
            themeMode: themeProvider.themeMode,
            theme: MyThemes.lightTheme,
            darkTheme: MyThemes.darkTheme,
            // home: const WearOsLogin(),
            initialRoute: RouterHelper.loginScreen,
            getPages: RouterHelper.routes,
            // routes: {'/': (context) => const LoginScreen()},
          );
        }));

    await tester.pumpAndSettle(const Duration(seconds: 8));
    String phoneNumber = "9808792437";
    String password = "password123";

    Finder phoneNumberKey = find.byKey(const ValueKey("phoneNumberKey"));
    await tester.enterText(phoneNumberKey, phoneNumber);

    Finder passwordKey = find.byKey(const ValueKey("passwordKey"));
    await tester.enterText(passwordKey, password);

    Finder btnLogin = find.byKey(ElevatedButton);
    await tester.tap(btnLogin);

    await tester.pumpAndSettle(const Duration(seconds: 8));

    Finder dashboard = find.text("Categories");
    expect(dashboard, findsOneWidget);
  });
}
